import React from 'react';
import '../main.css';
import AuthorPile from './AuthorPile'

export function AdOculos() {
  return (
    <div className="page-template">
      <h2>Lowering the Barrier</h2>
      <p>Some text here</p>



    </div>
  );
}

export function WhatsappMisinfo() {
  return (
    <div className="page-template">
      <h2>Misinfo on WhatsApp</h2>
      <AuthorPile authors={[
          ["Kevin Feng", require('./img/people/kjfeng.jpeg')],
          ["Kai Ji Feng", require('./img/people/kjfeng.jpeg')],
          ["K.J. Kevin Feng", require('./img/people/kjfeng.jpeg')],
          ["kjfeng", require('./img/people/kjfeng.jpeg')],
        ]}/>
      <p className="venue-page">Venue 2021</p>

      <h3>Abstract</h3>
      <p>Abstract goes here</p>

      <h3>Materials</h3>
      <p>Links to materials</p>

    </div>
  );
}


